// frontend/src/components/Layout/Header.js
import React, { useState, useEffect, useRef } from "react";
import { Link, NavLink, useLocation, useSearchParams } from "react-router-dom";

const leaguesNav = [
  { code: "PL", name: "Premier League" },
  { code: "BL1", name: "Bundesliga" },
  { code: "SA", name: "Serie A" },
  { code: "PD", name: "La Liga" },
  { code: "FL1", name: "Ligue 1" },
];
const mainNavLinks = [
  { to: "/", text: "Главная" },
  { to: "/history", text: "История матчей" },
  { to: "/tables", text: "Турнирные таблицы" },
];

function Header() {
  const [isLeaguesDropdownOpen, setIsLeaguesDropdownOpen] = useState(false);
  const dropdownRef = useRef(null);
  const location = useLocation();
  const [searchParams] = useSearchParams(); // Получаем searchParams

  useEffect(() => {
    /* ... useEffect для закрытия дропдауна ... */
  });
  useEffect(() => {
    setIsLeaguesDropdownOpen(false);
  }, [location.pathname, location.search]);

  // frontend/src/components/Layout/Header.js
  // ...
  // Стили для кнопок навигации - ОБНОВЛЕНО
  const navButtonBaseClasses =
    "px-4 py-2 rounded-full text-xs sm:text-sm font-semibold transition-all duration-200 ease-in-out focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-brand-surface";
  // Активная кнопка: КРАСНЫЙ фон, ЖЕЛТЫЙ текст, КРАСНОЕ свечение
  const navButtonActiveClasses =
    "bg-brand-button-active-bg text-brand-primary-yellow shadow-red-button-glow"; // <--- ИЗМЕНЕНО ЗДЕСЬ
  // Неактивная кнопка: темно-серый фон, ЖЕЛТЫЙ текст, при наведении подсветка и ЯРКО-ЖЕЛТЫЙ текст
  const navButtonInactiveClasses =
    "bg-brand-button-inactive-bg text-brand-primary-yellow hover:bg-brand-button-hover-bg hover:text-brand-button-hover-text hover:shadow-red-button-glow";
  // ...
  // Определяем, активна ли кнопка "Лиги" (выбрана лига в URL или дропдаун открыт)
  const isLeagueButtonActive =
    isLeaguesDropdownOpen || !!searchParams.get("league");

  return (
    <header className="bg-brand-surface shadow-md sticky top-0 z-50 w-full">
      <div className="absolute bottom-0 left-0 right-0 h-0.5 bg-gradient-to-r from-transparent via-brand-primary-red to-transparent opacity-60"></div>
      <div className="container mx-auto px-4 h-16 flex justify-between items-center relative">
        <Link to="/" className="hover:opacity-90 transition-opacity">
          <span className="text-2xl md:text-3xl font-extrabold text-gradient-red-yellow tracking-tight">
            NeuroPredict
          </span>
        </Link>

        <nav className="flex items-center space-x-1 sm:space-x-2 md:space-x-3">
          {mainNavLinks.map((link) => (
            <NavLink
              key={link.to}
              to={link.to}
              className={({ isActive }) =>
                `${navButtonBaseClasses} ${
                  // Кнопка "Главная" активна, только если это чистый "/" без "?league="
                  (link.to === "/" && isActive && !location.search) ||
                  (link.to !== "/" && isActive)
                    ? navButtonActiveClasses
                    : navButtonInactiveClasses
                }`
              }
            >
              {link.text}
            </NavLink>
          ))}

          <div className="relative" ref={dropdownRef}>
            <button
              onClick={() => setIsLeaguesDropdownOpen((prev) => !prev)}
              className={`${navButtonBaseClasses} ${
                isLeagueButtonActive // Используем новую переменную для определения стиля кнопки "Лиги"
                  ? navButtonActiveClasses // Если активна (дропдаун открыт ИЛИ лига выбрана) - красная
                  : navButtonInactiveClasses // Иначе - стандартная неактивная (темно-серая с желтым текстом)
              } flex items-center`}
            >
              Лиги
              <svg
                className={`w-3 h-3 ml-1.5 transform transition-transform ${
                  isLeaguesDropdownOpen ? "rotate-180" : ""
                }`}
                fill="currentColor"
                viewBox="0 0 20 20"
              >
                <path
                  fillRule="evenodd"
                  d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z"
                  clipRule="evenodd"
                ></path>
              </svg>
            </button>
            {isLeaguesDropdownOpen && (
              <div className="absolute left-0 mt-2 w-56 bg-brand-surface rounded-md shadow-xl z-30 py-1 border border-gray-700">
                {leaguesNav.map((league) => (
                  <NavLink
                    key={league.code}
                    to={`/?league=${league.code}`}
                    className={`block px-4 py-2 text-sm w-full text-left transition-colors
                      ${
                        searchParams.get("league") === league.code // Выбранная лига в дропдауне
                          ? "bg-brand-primary-red text-brand-primary-yellow" // Красный фон, белый текст
                          : "text-brand-primary-yellow hover:bg-gray-700 hover:text-brand-primary-yellow" // Остальные - желтый текст
                      }`}
                  >
                    {league.name}
                  </NavLink>
                ))}
              </div>
            )}
          </div>
        </nav>

        <div className="w-0 sm:w-32 md:w-48 lg:w-[18rem] hidden sm:block"></div>
      </div>
    </header>
  );
}
export default Header;
